import {useState} from 'react'
import DialogTitle from "@mui/material/DialogTitle";
import Dialog from "@mui/material/Dialog";



const myMap = new Map([
    ['apai4159', '#StriveToThrive'],
    ['davidChanNot', 'BurmesePerson9000'
    ],["matthewOverwatchExtremist", 'Eggos'],
    ["vikramThemeekram", "WiiRigger"]
  ]);

export default function Passwords({onLogin}){

    const [buttonPopup, setButtonPopup] = useState(false)
    const buttonStyle = {
        width: "10rem",
        fontsize: "1.5rem",
        height: "2rem",
        padding: "5px",
        borderRadius: "10px",
        backgroundColor: "green",
        color: "White",
        border: "2px solid yellow",
     };
     const divStyle = {
        display: "flex",
        felxDirection: "row",
        position: "absolute",
        right: "0px",
        bottom: "0px",
        // padding: "1rem",
     };
     const confirmButtonStyle = {
        width: "5rem",
        height: "1.5rem",
        fontsize: "1rem",
        backgroundColor: "grey",
        color: "black",
        margin: "5px",
        borderRadius: "10px",
        border: "1px solid black",
     };




    return (
        <>
            <h1 style={{textAlign: "center"}}>Welcome to Fakyak!</h1>
            <h2 style={{textAlign: "center"}}><i>Please enter your username and password:</i></h2>
            <div style={{alignItems: "center", paddingTop: 100}}>
                <label>Username: </label>
                <input type="text" id="user101" name="user"/>
                <br/>
                <br/>
                <label>Password: </label>
                <input type="text" id="pass101" name="pass"/>
                <br/>
                <br/>
                <br/>
                <button onClick={() => {
                    let str = document.getElementById("user101").value;
                    if(myMap.has(str)){
                        if (myMap.get(str) === document.getElementById("pass101").value){
                            onLogin(1);
                            return;
                        }
                        onLogin(-1);
                        return;
                    } 
                    onLogin(-1);
                    return;
                }}>SUBMIT</button>

                <br/>
                <br/>
                <br/>
                <button style = {buttonStyle} onClick = {()=> setButtonPopup(true)}>
                    Create a Log-In
                </button>
                <Dialog style={{width: 1000, height: 1000}} onClose = {() => setButtonPopup(false)} open = {buttonPopup}>
                    <DialogTitle> Create Log-In! </DialogTitle>
                    <h1>Hello</h1>
                    <h1>Goodbye</h1>
                    <h1>Yeet</h1>
                    <br/>
                    <br/>
                    <br/>
                    <div style = {divStyle}>
                        <button style = {confirmButtonStyle} onClick = {() => setButtonPopup(false)}>
                            Confirm
                        </button>
                        <button style = {confirmButtonStyle} onClick = {() => setButtonPopup(false)}>
                            Cancel
                        </button>
                    </div>
                </Dialog>
            </div>

        </>
    )
}
